webstoreListingDescription.message:
Instal ekstensi AudD dan klik ikonnya untuk mengidentifikasi lagu yang diputar di tab saat ini.
Tonton video di atas untuk melihat cara kerjanya.

Ekstensi AUDD:
- Mengenali musik yang diputar di browser Anda;
- Menemukan musik di database AudD dengan lebih dari 75 juta lagu menggunakan teknologi pengenalan musiknya;
- Menampilkan lirik untuk lagu yang diidentifikasi;
- Menampilkan tautan untuk mendengarkan lagu di Apple Music, Spotify, Deezer, YouTube Music;
- Menampilkan momen yang tepat dalam lagu yang dikenali saat suara dari browser diputar.

API Pengenalan Musik: https://audd.io
Kode sumber: https://github.com/AudDMusic/chrome-extension

Ekstensi Didukung Oleh AudD® Music recognition API

Dibuat dan dirancang oleh tim AudD.io dengan bantuan Eric Stark, Mitchell Kossoris, dan Ivan Kasatkin.
